import "./ExpenseItems.css";

function ExpenseItems(prpos) {
    
    
    return (
    <div className="expense-item">
      <div>{prpos.date.toISOString()}</div>
      <div className="expense-item__description">
        <h2>{prpos.title}</h2>
        <div className="expense-item__price">${prpos.amount}</div>
      </div>
    </div>
  );
}

export default ExpenseItems;
